import React from "react";
import {
    Container,
    LogoBread,
    LogoIcon,
    LoginSide,
    PersonIcon,
    ToHead,
    BoHead,
    Input,
    WrapperInput,
} from "./AllStyles";

import { Button } from "../Global/Button/Button";
const Head = () => {
    return (
        <Container>
            <ToHead>
                <LogoBread>
                    <LogoIcon />
                    <span>w.OI</span>
                </LogoBread>
                <LoginSide>
                    <Button outlined rounded>
                        Login
                    </Button>
                    <WrapperInput>
                        <label htmlFor="input-profile">
                            e
                        </label>
                        <Input id="input-profile" placeholder="E-mail" />
                    </WrapperInput>
                    <PersonIcon />
                </LoginSide>
            </ToHead>
            <BoHead></BoHead>
        </Container>
    );
};

export default Head;
